INSERT INTO `diagnostico` (`ID_D`, `ID_Doctor`, `Cedula_Paciente`, `fecha`, `motivoConsulta`, `diagnostico_1`, `diagnostico_2`, `diagnosticoDescripcion`, `tratamiento_1`, `tratamiento_2`, `recibeTratamiento_1`, `recibeTratamiento_2`, `posologia`) VALUES
(12, 3, '21726', '2018-06-21', 'Dolor fuerte en la rodilla.\r\nProducto de caida de una bicicleta.\r\nPerdio el equilibrio luego de un fuerte dolor.\r\n\r\nEl dolor se presento en la rodilla izquerda.\r\nPero cuando cayo se golpeo la rodilla derecha.\r\n\r\nEsta caida pudo ser el inicio de una lesion muscular importante.\r\nAnteriormente el paciente manifesto un dolor parecido\r\nPero no le dio importancia.', '(M65.0) Absceso de vaina tendinosa\r\n\r\n(M65.3) Dedo en gatillo\r\n\r\n(M65.4) Tenosinovitis de estiloides radial [de Quervain]\r\n\r\n(M65.9) Sinovitis y tenosinovitis, no especificada\r\n\r\n(M66.5) Ruptura espontánea de tendón no especificado\r\n\r\n(M67) Otros tra', '', 'La lesión va a ameritar intervención quirurgica.', 'Antibióticos', 'Analgésicos', 'Baflox\r\nBenzetacil\r\nCeftriaxona', 'Diklason\r\nAcido Acetilsalicilico\r\nMelocox\r\nMeloxicam', 'Baflox: 2 veces al dia antes de comer\r\nBenzetacil: En ayunas por cinco dias.\r\nCetriaxona: Interdiaria antes de dormir.\r\n\r\nDiklason: cada cinco horas por 3 dias.\r\nAcido acetilsalicilico: en el desayuno\r\nMelocox: Desayuno'),
(13, 3, '21726', '2018-07-13', 'El paciente presenta dolor lumbar fuerte.\r\nManifiesta tener dos hernias discales.\r\nHa suspendido el tratamiento prescrito.', '(M81.6) Osteoporosis localizada [Lequesne], sin fractura patológica\r\n\r\n(M82.0) Osteoporosis en mielomatosis múltiple (C90.0+)\r\n\r\n(M82.8) Osteoporosis en otras enfermedades clasificadas en otra parte', '', '', 'Antibióticos', 'Analgésicos', 'Cloranfenicol\r\nDroxifan', 'Diclofenac\r\nMeloxicam\r\nPainfort', 'Cloranfenicol: dos veces al dia por una semana\r\nDroxifan: despues de cada comida, tres veces al dia\r\nDiclofenac: cuando presente dolor.\r\nMeloxicam: Antes de acostarse, con una bebida natural'),
(14, 3, '21726000', '2018-08-30', 'El paciente presenta dolor lumbar fuerte.\r\nManifiesta tener dos hernias discales.\r\nHa suspendido el tratamiento prescrito.', '(M48.2) Espondilopatía interespinosa (vértebras \"en beso\")\r\n\r\n(M48.5) Vértebra colapsada, no clasificada en otra parte\r\n\r\n(M49.0) Tuberculosis de la columna vertebral', '', '(Texto para ampliar el diagnotico)', 'Analgésicos', 'Antibióticos', 'Adolen\r\nDipirona\r\nMelocox', 'Ciprofloxacina\r\nCloranfenicol', 'Adolen: dos veces al dia por una semana\r\nDipirona: despues de cada comida, tres veces al dia\r\nMelocox: cuando presente dolor.\r\nCiprofloxacina: Antes de acostarse, con una bebida natural\r\nCloranfenicol: tres veces al dia inmediatamente despues de cada comida'),
(15, 3, '21726000', '2018-09-02', 'Dolor fuerte en la rodilla.\r\nProducto de caida de una bicicleta.\r\nPerdio el equilibrio luego de un fuerte dolor.\r\n\r\nEl dolor se presento en la rodilla izquerda.\r\nPero cuando cayo se golpeo la rodilla derecha.\r\n\r\nEsta caida pudo ser el inicio de una lesion muscular importante.\r\nAnteriormente el paciente manifesto un dolor parecido\r\nPero no le dio importancia.', '(M66.0) Ruptura de quiste sinovial poplíteo\r\n\r\n(M66.2) Ruptura espontánea de tendones extensores\r\n\r\n(M66.3) Ruptura espontánea de tendones flexores\r\n\r\n(M67.0) Acortamiento del tendón de Aquiles (adquirido)\r\n\r\n(M67.1) Otras contracturas de tendón (vai', '', 'La lesión va a ameritar intervención quirurgica.', 'Analgésicos', 'Antibióticos', 'Diklason', 'Ceftriaxona\r\nBaflox\r\nBenzetacil', 'Baflox: 2 veces al dia antes de comer\r\nBenzetacil: En ayunas por cinco dias.\r\nCetriaxona: Interdiaria antes de dormir.\r\n\r\nDiklason: cada cinco horas por 3 dias.');

